import React from "react"
import Header from "../components/Header";

function Blogs() {
  return (<>
    <div>
      <Header index="2" />
    </div>
    <div className="container"></div>
    <p>This page is still in the works.<br /><br /> Stay Tuned!</p>
</>
  );
}

export default Blogs;
